import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"
import Tablestudent from "./tabelStudent"

function Ava(){
    const params=useParams()
    const [data,setdata]=useState("")
    useEffect(()=>{
        fetch(`http://localhost:9000/Ava/${params.Id}`)
        .then(res=>res.json())
        .then(data=>setdata(data))
    },[])
    console.log(data);
    return(
        <div>
            {data.map((Ava)=>{
                return(

             <Tablestudent Ava={Ava}/> 
            )
            })}



        </div>
    )
}
export default Ava
